import React from "react";
import PropTypes from "prop-types";

const foodILike = [
  {
    id: 1,
    name: "kimchi",
    image:
      "https://cdn.pixabay.com/photo/2017/06/28/03/58/kimchi-2449656_960_720.jpg",
    rating: 5,
  },
  {
    id: 2,
    name: "ramen",
    image:
      "data:image/jpeg;base64,",
    rating: 4.5,
  },
  {
    id: 3,
    name: "bibimbap",
    image:
      "data:image/jpeg;base64,",
    rating: 3.8,
  },
  {
    id: 4,
    name: "doncasu",
    image:
      "data:image/jpeg;base64,",
    rating: 5.0,
  },
  {
    id: 5,
    name: "kimbap",
    image:
      "data:image/jpeg;base64,",
    rating: 4.7,
  },
];

function Food({ name, picture, rating }) {
  return (
    <div>
      <h2>{name}</h2>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
};

function renderFood(dish) {
  return (
    <Food
      key={dish.id}
      name={dish.name}
      picture={dish.image}
      rating={dish.rating}
    />
  );
}

function App() {
  return <div>{foodILike.map(renderFood)};</div>;
}

export default App;
